sys_variable_value.value:
(function execute(inputs, outputs) {


if(inputs.code==200){
    var txn=inputs.txn;
    if(JSON.parse(inputs.response).body && (JSON.parse(inputs.response).body.PDF)){
var byteArray=(JSON.parse(inputs.response).body.PDF);
var req=JSON.parse(inputs.request);
var appNo=(JSON.parse(inputs.request).body.quoteid);
    outputs.response= new global.getbase64forintegration().convertByteArray(txn,(byteArray),appNo,req.productId,req.variantId,"HDFC"); 
}
else{
    outputs.response=inputs.response;
}
}
else{
    var res="";
    if(inputs.response.head)
    res=inputs.response;
    else
    res=JSON.parse(inputs.response);

    

    outputs.code=500;
    outputs.msg=res.head.error[0].msg
}
})(inputs, outputs);

